  04> ROSS, James Alexander m on 29.11.1986 to JOYCE, Sarah Louise
  b 28.11.1955
  b 01.01.1959
  James b. at Birmingham and m. at Kimmeridge, Dorset, England. Sarah, d/o Eric Joyce and Rosemary
  Gardner, b. at Windsor. Address: Kimmeridge House, 4 Windmill Gardens, Staverton, Daventry,
  Northants, England.
  James was educated at King's School, Worcester and Durham University and qualified BA(Durham) ACIB.
  He is now a member of the senior management team in Barclay's Bank's credit card division,
  Barclaycard, Northampton.
  Sarah was educated at Mayfield School, Putney, and Hounslow College and is currently graphic
  designer with York Fitness UK Ltd.
