  02> 'MACLEAN, Kenneth Joseph m on 22.02.1949 to WHITCOMBE, Joan Mary Somerset
  Palmer (Joe)
  b 12.01.1917 d 14.08.1992
  b 14.04.1916
  Joseph b. at Rotorua and m, at St Mary's Church, Merivale, Christchurch, Joan,
  d/o Bertie Ernest Hawkes Whitcombe and Fannie Allingham Morrow. Address: 2/23
  Box Hill, Khandallah, Wellington.
  Joe was educated at Hereworth School (1927-30), Wanganui Collegiate School
  (1931-34), Canterbury University College (1935-38, BA) and Pembroke College,
  O Cambridge (1938-40, MA). He was attached to the Ministry of Supply in the UK
  (nominally in RAFVR) from 1940 to 1945 and served on the Control Commission for Germany from 1945 to
  1947. He held a succession of positions with Shell Oil (NZ) Ltd from 1947 to 1976, retiring as
  Personnel Manager. He attended Victoria University of Wellington (1977-78) and graduated BA (Hons). He
  was a selection adviser for Volunteer Service Abroad (and an honorary Life Member) and served as
  Vestryman and Peoples' Warden for St Mary's Church, Karori.
  Joan was co-author, with her son, Christopher, of "Waikanae - Past and Present". She also served on the
  Board of Governors of the NZ Hearing Association.
